	--- **displayId Behaviour**
	--- 
	--- | display ID 	| Behaviour                                                   	|
	--- |------------	|-------------------------------------------------------------	|
	--- | 0          	| Doesn't show up, ever, anywhere.                            	|
	--- | 1          	| Doesn't show up, ever, anywhere.                            	|
	--- | 2          	| Shows on both main map and minimap. (Selectable on map)     	|
	--- | 3          	| Shows on main map only. (Selectable on map)                 	|
	--- | 4          	| Shows on main map only. (Selectable on map)                 	|
	--- | 5          	| Shows on minimap only.                                      	|
	--- | 6          	| Shows on both main map and minimap. (Selectable on map)     	|
	--- | 7          	| Doesn't show up, ever, anywhere.                            	|
	--- | 8          	| Shows on both main map and minimap. (Not selectable on map) 	|
	--- | 9          	| Shows on minimap only.                                      	|
	--- | 10         	| Shows on both main map and minimap. (Not selectable on map) 	|
	--- 
	--- Anything higher than 10 seems to be exactly the same as 10.
	--- 
	--- Rockstar seem to only use 0, 2, 3, 4, 5 and 8 in the decompiled scripts.
	---@param blip integer
	---@param displayId integer
	SET_BLIP_DISPLAY=function(blip,displayId)return InvokeVoid(0x9029B2F3DA924928,blip,displayId)end,

	--- Examples result:
	--- 
	--- ![](https://i.imgur.com/skY6vAJ.png)
	--- 
	--- **index:**
	--- 
	--- 
	--- 1 = No distance shown in legend
	--- 2 = Distance shown in legend
	--- 7 = "Other Players" category, also shows distance in legend
	--- 10 = "Property" category
	--- 11 = "Owned Property" category
	--- 
	--- 
	--- Any other value behaves like `index = 1`, `index` wraps around after 255
	--- 
	--- Blips with categories `7`, `10` or `11` will all show under the specific categories listing in the map legend, regardless of sprite or name.
	--- 
	--- **Legend entries**
	--- 
	--- | index | Legend entry | Label |
	--- | --- | --- | --- |
	--- | 7 | Other Players | `BLIP_OTHPLYR` |
	--- | 10 | Property | `BLIP_PROPCAT` |
	--- | 11 | Owned Property | `BLIP_APARTCAT` |
	---@param blip integer
	---@param index integer
	SET_BLIP_CATEGORY=function(blip,index)return InvokeVoid(0x234CDD44D996FD9A,blip,index)end,

