	--- 8 = CTaskVehicleFleeAirborne  
	--- 9 = CTaskVehicleCircle  
	--- 10 = CTaskVehicleEscort  
	--- 15 = CTaskVehicleFollowRecording  
	--- 16 = CTaskVehiclePoliceBehaviour  
