	---     // Vehicle is locked, but its trunk/boot remains unlocked.
	---     VEHICLELOCK_LOCKED_BUT_BOOT_UNLOCKED = 8,
	---     // Vehicle is locked and does not allow passengers, except for the driver.
	---     VEHICLELOCK_LOCKED_NO_PASSENGERS = 9,
